Chris and Alex are joined by Doctor Who sidekick Amy Pond, the actress Karen Gillan, 
who talks about the brand new series of Doctor Who. The voice of the Dalek is out and 
about to meeting the people of Slough. Chris and Alex also catch up on all the 
Paralympics news and have the very moving story of the soldier who was declared dead 
in Afghanistan and is now going for gold in the Games.

